import axios from "axios"

export const config={
    url:'http://localhost:5000/'
}
export  function select_route(){
    var permession=window.sessionStorage.getItem('permession')
    if(permession==="admin"){
      return(<Route exact={true} path="/backend/admin"element={<Backend/>}/>)
    }
    else if(permession==="manager"){
        return(<Route exact={true} path="/backend/manager"element={<Backend/>}/>)
    }
    else{
        return(<Route exact={true} path="/backend/personal"element={<Backend/>}/>)
    }
  }


export async function login(login_data,navigate){
    await axios({
        method:'POST',
        url:config.url,
        data:{
            'account':login_data.account,
            'password':login_data.password
        },
        headers:{
            'Content-Type': 'application/json',
            'Access-Control-Allow-Origin':'*'
        }
    }).then((response)=>{
        var data=response.data
        console.log(data)
        window.sessionStorage.setItem('token',data.token)
        window.sessionStorage.setItem('user_name',data.user_name)
        window.sessionStorage.setItem('banch',data.banch)
        window.sessionStorage.setItem('permession',data.permession)


    }).catch((error)=>{
        alert('帳號或密碼輸入錯誤')

    })
}
